        <h2 id="heading-0"><strong>●ご挨拶</strong></h2><iframe class="ql-video" frameborder="0" allowfullscreen="true" src="https://www.youtube.com/embed/M_GmyspTe1o?embed_config=%7B%22enc%22:%22AYAC26erUjAkW-SE6RuhHhqXtFv51BVOY8N83DBth5rwujBwW6BxBP2JVbrAEyyCrJ9d7__34yXuqb95i9GBvYxjxrvFJZJkdItU8dDbznq9qPwlfNqJS0bBMmYT-2xOxdVqVKwkSZkviE4pLpWHZ8k1lLYUQaS73rzCGMzor8pw3fbA%22%7D&amp;errorlinks=1&amp;rct=CpcBAYAC26f2QmMDN8jsLpN3i0Egvs721sz5wnyEI8qBU-hTKvpWUKkkeNPe8fYn7YG7EwyLZym7CBqauai4UQ-HWZJLjQac9S1Yz6OBchnDE5dbJIFM7SI-sOg_kv4NLjbcd2MtGuPURWSkf1PH40zuWSYtAqt-03pZYmGXvjmpOmCDTzD9wJaUvQLRdVW5WnpwBEKKOwlEjw%3D%3D"></iframe><p><br></p><p>拝啓</p><p>今年も残すところわずかとなりました。</p><p>皆様におかれましては、ご家族やスタッフの皆様と共に、充実した一年を過ごされましたでしょうか。</p><p><br></p><p>2024年も全国各地で「おそうじ革命」の名のもと、多くのお客様のご期待に応えられるサービスを提供していただき、誠にありがとうございました。</p><p>皆様の日々のご努力と真摯な取り組みによって、ブランドの信頼を一層高めることができましたこと、心より感謝申し上げます。</p><p><br></p><p>特に年末の忙しい時期においても、お客様に安心と快適をお届けするためにご尽力いただいていることに、改めて敬意を表します。</p><p>お客様からの「ありがとう」という言葉が、私たちの最大の誇りであり、原動力であると感じています。</p><p><br></p><p>2025年も皆様と共にさらなる成長を目指し、より良いサポートを提供できるよう本部一丸となって努めてまいります。</p><p>引き続き、皆様のご意見やご要望をお聞かせいただきながら、共に歩んでいければ幸いです。</p><p><br></p><p>寒さ厳しい折、どうぞ体調を崩されませんよう、ご自愛ください。</p><p>新しい年が、皆様にとって素晴らしい一年となりますよう、心よりお祈り申し上げます。</p><p><br></p><p>敬具</p><p><br></p><p>株式会社KIREI produce</p><p>バリューサポート課　一同</p><h2 class="ql-align-center" id="heading-1"><br></h2><h2 id="heading-2"><strong>●最新アナウンス</strong></h2><h3 class="ql-align-center" id="heading-3"><br></h3><h3 id="heading-4"><strong>1.</strong><strong style="color: rgb(255, 0, 0);">2025年2月14日(金) KIREI AWARD 2025 開催決定！</strong></h3><p>この一年の成果を讃え合い、新たな絆を深める特別な日へ。皆様のご参加を心よりお待ちしています！</p><iframe class="ql-video" frameborder="0" allowfullscreen="true" src="https://drive.google.com/file/d/1kb7OIpuimVAyaSQd9qckriEsYaOp805M/preview?authuser=0"></iframe><p><br></p><p><br></p><iframe class="ql-video" frameborder="0" allowfullscreen="true" src="https://docs.google.com/forms/d/e/1FAIpQLSdaT6GZ0b2kbgKRTQZ_CE84OhHK6MvO4j_NBStnxYEsHNMuuw/viewform?embedded=true"></iframe><p><br></p><iframe class="ql-video" frameborder="0" allowfullscreen="true" src="https://www.youtube.com/embed/-joWpc711ns?embed_config=%7B%22enc%22:%22AYAC26c6FjN72niraAjXsaIxW_Pr1YfqlZ_tqysvoDcMXSYHJ2KPon5G_tMqyQur8-1RZQ7hO-r72hJvr6udr2okKejcQGfFN3lANtiNTuaVetEskacNacNgFaOfob4V8EoZNaE7M7-nE0-jd6hbcpqa6E9Q0pVRz4_o8tdkMHp9Byam%22%7D&amp;errorlinks=1&amp;rct=CpcBAYAC26cPj75Hgx8f-YV2k582lc5sseMAkwO41I55QpTPyacJPnvagVKs_WvVHtBu0A_BjO3ZQglJFY1i9VYk2tq5sr9BkmAd7T1YZO-vKBzLUVMh0hVPNB04UEKsGi_4b6WgwsHf-WHwTAJT_7LIisYOGcxAn5Vy4wh_sTg5HQAEoOQb0iaW0E4tTPPBY0sjeA-nSLJE4Q%3D%3D"></iframe><p><br></p><h3 class="ql-align-center" id="heading-5"><br></h3><h3 id="heading-6"><strong>2.価格表を更新しました</strong></h3><p>2025年2月より適用の価格表を更新しました</p><p>以下の項目について価格が変更となりますのでご確認ください。</p><p><br></p><p>・変更箇所</p><p>水回り（キッチン、浴室、レンジフード、各種セットメニュー）</p><p>詳細は添付の価格表をご確認ください。</p><p>ーーーーーーーーーーーーーーーーーーーーー</p><p>また、Googleビジネスプロフィールのアイコン表示については、1月下旬までに新価格へ差し替えをお願いいたします。</p><p><br></p><p>新定価適用開始日：2025年2月1日以降のご注文から</p><p>※1月中にご注文いただいた2月作業分は旧価格でご案内ください。</p><p><br></p><p>ご不明点はお気軽にお問い合わせください。</p><p><br></p><iframe class="ql-video" frameborder="0" allowfullscreen="true" src="https://drive.google.com/embeddedfolderview?authuser=0&amp;id=1AGiZql784D0na3_KsHlEiRBkwqs-wIeP#grid"></iframe><p><br></p><p><br></p><iframe class="ql-video" frameborder="0" allowfullscreen="true" src="https://drive.google.com/embeddedfolderview?authuser=0&amp;id=1Nt4_UDtSfTlO4nCrgMuUicn8SsfcDhrx#grid"></iframe><p><br></p><h3 class="ql-align-center" id="heading-7"><br></h3><h3 id="heading-8"><strong>4.休業日のご案内</strong></h3><p>本部の休業情報について、以下の通りお知らせいたします。</p><p><br></p><p>1月13日(月)</p><p>12:00まで通常営業</p><p>12:00～ 社内行事のため休業</p><p><br></p><p>1月29日(水)</p><p>9:00～12:00まで通常営業</p><p>12:00～ 社員研修のため休業</p><p><br></p><p>2月9日(日)</p><p>ビル全館停電のため終日休業</p><p><br></p><p>なお、緊急のご連絡が必要な場合は、バリューサポート課担当者へ個別にご連絡いただきますようお願い申し上げます。</p><p>何卒、よろしくお願い申し上げます。</p><h3 class="ql-align-center" id="heading-9"><br></h3><h3 id="heading-10"><strong>5.おそうじ革命 全国一斉アンケート ※最終リマインド</strong></h3><p><img src="https://lh3.googleusercontent.com/3BPL0GGIflbdFH3VBhhPrCn1hsYohJAkqMG6ISXGWPbqoGeZiZw_wSkXeuw1HyAq001P8AjGBEqHOgLQ8-ye9GX3hJ8on_ix9Mc-WIcN5oGSbdZovPtft-S04FIUbbQPAA=w1280"></p><p>11月11日に配信させていただきました「オリコン施策 サービス向上アンケート」の件について、再度ご案内させていただきます。</p><p>2020年から21・22・23・24年とオリコン顧客満足度第1位を5年連続で受賞することができ、改めて日々のご対応に感謝申し上げます。</p><p><br></p><p>しかし僅差の1位と、他社のレベルも上がってきており、満足度向上のためさらなる改善が必要だと感じました。</p><p><br></p><p>おそうじ革命の強み、それは<span style="color: rgb(255, 0, 0);">「徹底力」</span>と<span style="color: rgb(255, 0, 0);">「接客力」</span>です。</p><p>お客様からいただくお褒めの言葉にも、 「接客が丁寧」「信頼できる」といったお客様からのお声を受けブランドの成長を感じる一方、</p><p>「担当者を変えてほしい」「どういう教育をしているんですか」といった声を耳にすることもあり、本部として危機感を持っています。</p><p><br></p><p>『おそうじ革命』ブランドをより強く、広く認知してもらうため、基本を見直す時期が来たのだと思っています。</p><p><br></p><p>これを機に、動画と資料の内容を全店の最低基準に設定します。</p><p><br></p><p>そこで、以下のツールを用意しました。</p><ol><li><a href="https://www.youtube.com/watch?v=9PSVzAJ9zFw" rel="noopener noreferrer" target="_blank" style="color: rgb(17, 85, 204);">動画 マナー編</a></li><li><a href="https://www.youtube.com/watch?v=ZS6_KlCEqFk" rel="noopener noreferrer" target="_blank" style="color: rgb(17, 85, 204);">動画 一連の流れ編</a></li><li><a href="https://www.youtube.com/watch?v=BKcMYSCRswk" rel="noopener noreferrer" target="_blank" style="color: rgb(17, 85, 204);">動画 接客トーク編</a></li><li><a href="https://drive.google.com/file/d/1GB79vngq2BxpFxIX6prQ8Dsvs_Ss6jwX/view" rel="noopener noreferrer" target="_blank" style="color: rgb(17, 85, 204);">資料 おそうじ革命 マナーBOOK</a></li></ol><p><br></p><p>あわせて、11月11日に配信した「サービス向上アンケート」の回答をお願い致します。</p><p><br></p><p>アンケートでは、 動画を視聴いただいた上で、現場での工夫や感じている課題 を教えてください。</p><p>皆様の声を基に基準を改善し、 「おそうじ革命らしいサービス」 をさらに進化させていきたいと考えています。</p><p><br></p><p>オリコンの評価は「結果」であり、目指すべきはお客様からの信頼と満足度だと信じています。</p><p><br></p><p>皆様とともに、おそうじ革命をより良いブランドにしていくため、ぜひお力を貸してください。</p><p><br></p><p><span style="color: rgb(255, 0, 0);">【回答期限】1月20日まで ※延長中</span></p><p>【アンケートフォームURL】<a href="https://forms.gle/F6cJY8wxjpMVg7GUA" rel="noopener noreferrer" target="_blank" style="color: rgb(17, 85, 204);">サービス向上アンケートフォーム</a></p><p>【重要】</p><p>未回答の場合、案件紹介を停止させていただきます。</p><p>これは、おそうじ革命としての基準を守り、加盟店全体の品質を均一化するための措置ですので、何卒ご理解ください。&nbsp;</p><p><br></p><h2 class="ql-align-center" id="heading-11"><br></h2><h2 id="heading-12"><strong>●バリューサポートコラム</strong></h2><h3 class="ql-align-center" id="heading-13"><br></h3><h3 id="heading-14"><strong>1.2025年排ガス規制について</strong></h3><p>ニュースでも取り上げられている通り、2025年に施行される新しい排出ガス規制について、皆さまにお知らせいたします。</p><p><br></p><p>2025年より、環境負荷低減のため、自動車の排出ガス基準が大幅に厳格化されます。この規制により、基準を満たさない自動車やバイクは購入できなくなる可能性があります。特に、2025年11月以降には第一種原付の販売が停止される予定です。</p><p>また、この規制に伴い、ジャイロに代わる後継車の登場についても注目しています。情報が確認でき次第、改めてお伝えいたします。</p><p>さらに、電気自動車（EV）やハイブリッド車（HV）などの低排出ガス車両への乗り換えが進むことが予想されます。こちらも詳細が分かり次第、共有させていただきます。</p><p><img src="https://lh5.googleusercontent.com/UNqQhNi6pPs-XHHxToQ8oMNHNkCNmVtrMA7ZtN2SRFII7-K6xSoP4meP6wuBmuOrlR0X6q59MvnV31e8pZKbAewdVTREQKWEyEwZUcr5irHjP9cJGpDO4BTz2ciwSH7HvQ=w1280"></p><h3 class="ql-align-center" id="heading-15"><br></h3><h3 id="heading-16"><strong>2.加盟店告知掲示板の直接案件について</strong></h3><p>掲示板で訪問したお客様の宅で当日お客様から自らの営業によって追加注文をいただいた場合、掲示板の案件詳細に追加するのではなく、新たに現場追加をしていただき、追加になった内容を追記していただくようお願い致します。元の案件詳細に追加することで紹介料対象に含まれますのでご注意ください。</p><p class="ql-align-center"><a href="https://sites.google.com/cleanrevolution.jp/vskameipage/%E4%BA%8B%E5%8B%99%E3%83%AB%E3%83%BC%E3%83%AB/%E6%A1%88%E4%BB%B6%E7%B4%B9%E4%BB%8B/%E3%81%8A%E5%AE%A2%E6%A7%98%E7%B4%B9%E4%BB%8B/%E6%8E%B2%E7%A4%BA%E6%9D%BF" rel="noopener noreferrer" target="_blank" style="color: rgb(28, 28, 28);">詳しくはこちら</a></p><p><br></p><h2 class="ql-align-center" id="heading-17"><br></h2><h2 id="heading-18"><strong>●ブランド案件情報</strong></h2><h3 class="ql-align-center" id="heading-19"><br></h3><h3 id="heading-20"><strong>1.業務提携先の価格改定について</strong></h3><p>法人営業部 アライアンス課でございます。</p><p>このたび、原材料費や諸経費の高騰を受け、2025年2月より定価の改定を実施する運びとなりました。</p><p>それに伴い、本部から加盟店様へご紹介する案件の応援料も一部改定させていただきます。</p><p><br></p><p>ただし、一部のブランド案件については、提携先の事情や契約内容により料金改定が難しい場合がございます。</p><p>そのため、これらの案件においては現行の応援料を維持することとなる可能性がございます。あらかじめご理解賜りますようお願い申し上げます。</p><p><br></p><p>本部としましては、提携先との良好な関係を維持し、新規販路の拡大や安定的な案件供給を進めることで、加盟店様の事業拡大を引き続き支援してまいります。</p><p>全国に広がる「おそうじ革命」の成長は、加盟店様のご理解とご協力あってこそ実現可能です。</p><p><br></p><p>今後とも共に力を合わせ、「おそうじ革命」のブランド価値向上に努めてまいります。</p><p>ご不明な点やご質問がございましたら、どうぞご遠慮無く本部までお問い合わせください。</p><p><br></p><p>引き続き、どうぞよろしくお願い申し上げます。</p><h3 class="ql-align-center" id="heading-21"><br></h3><h3 id="heading-22"><strong>2.ブランド案件掲示板に関する注意喚起 ※リマインド</strong></h3><p>運用ルールが誤認されているケースが見受けられるため、改めてフローとルールを共有いたします。以下の内容をご確認いただき、円滑な運用をお願いいたします。</p><p><br></p><p>【運用ルール】</p><p>①初回連絡について</p><p>　承認後、24時間以内にお客様へ日程調整のため、電話およびSMSまたはメールで1回目の連絡を行ってください。</p><p>　※電話が繋がらない場合はSMSを送信してください。</p><p><br></p><p>②差し戻し可能期間</p><p>　案件承認後、3〜4日以内に差し戻しが可能です。※連絡がつながらない場合のみ対応します。</p><p><br></p><p>③継続アプローチ</p><p>　お客様に繋がらない場合は、1日最低1回のアプローチを行ってください。</p><p><br></p><p>④メニュー追加依頼への対応</p><p>　お客様からメニュー追加の依頼（当日含む）があった場合は、速やかに本部（03-6432-0823）へご相談ください。</p><p><br></p><p>⑤日程調整・キャンセルの場合</p><p>　お客様の希望日程が自身の都合と合わない場合、またはキャンセルとなった場合は、本部へご相談ください。</p><p><br></p><p>⑥決済方法の変更対応</p><p>　お客様から決済方法の変更依頼があった場合は、本部へご相談ください。</p><p><br></p><p>⑦キャンセル時の対応</p><p>　キャンセルが発生した場合は、速やかに本部（03-6432-0823）へご連絡ください。</p><p><br></p><h2 class="ql-align-center" id="heading-23"><br></h2><h2 id="heading-24"><strong>●コスモ改修</strong></h2><p class="ql-align-center"><a href="https://sites.google.com/cleanrevolution.jp/vskameipage/%E3%82%B3%E3%82%B9%E3%83%A2/%E3%82%B3%E3%82%B9%E3%83%A2%E3%82%A2%E3%83%83%E3%83%97%E3%83%87%E3%83%BC%E3%83%88/2024" rel="noopener noreferrer" target="_blank" style="color: rgb(28, 28, 28);">過去のコスモアップデート情報はこちら</a></p><p><br></p><h2 class="ql-align-center" id="heading-25"><br></h2><h2 id="heading-26"><strong>●ホームページ改修</strong></h2><h3 class="ql-align-center" id="heading-27"><br></h3><h3 id="heading-28"><strong>1.エアコン&amp;水回りセット メインビジュアル追加 1月ver</strong></h3><p>1月のメインビジュアルが新たに追加となります。</p><p>変更はCMSから行うことができますのでぜひご活用ください。</p><p><img src="https://lh5.googleusercontent.com/cGJXY2W2RfgikYl3ueIf1l0nlbuXES8dfdapyhxqAf3OPzsqfdBaE8VtP8IopCHbHEsFL4Aa9hj5J5atPjwKaJ68TK5klJEHEhbYMJjxUK7Qdy_s2EfPFaBTaGOIC-Nq=w1280"></p><p><img src="https://lh3.googleusercontent.com/v3aTl2l-rLaW6yRexFqLcpHvtwhL1LRAjvq7gjTSweeOKOn8BQ0-10Ch6RZzwaeq5yt3sbKbMyS9GUeAfxY3BN2XLgWCveAMduM3bC5p-1j1BQmT28AtxH4OEUjc44q0zw=w1280"></p><p><img src="https://lh4.googleusercontent.com/xn9NLLikfLbcqqf72uFtiNDIzROzkKk-tN32fNPcU4bcSlJvUmn3NGw40NTZWC13jPSthVamdf5wN827U5yNJ3NVmXeN5sK2TCn35I8tfgfr-LbKHKsyuRzsJTXgdbJBqA=w1280"></p><h3 class="ql-align-center" id="heading-29"><br></h3><h3 id="heading-30"><strong>2.サイトタイトル表示の改修</strong></h3><p>検索時に表示されるサイトタイトルを「おそうじ革命」表示されるように改修しました。</p><p><img src="https://lh5.googleusercontent.com/143RFmo-xZS4d0hn8I0segHypYBg9pBfgNudtznBE8-G1K1jks8zQAlkimZ2wANfcMREVa01nPZPSyG4pXbSuk_EZ2NzSfbFzfyg3YRMQC-9A_KcgE0OndgrCyJxy6WZUA=w1280"></p><p><br></p><h2 class="ql-align-center" id="heading-31"><br></h2><h2 id="heading-32"><strong>●顧客様から頂いたお褒めの言葉</strong></h2><p>ホームページに寄せられたお褒めの言葉を紹介いたします。</p><p>多くの良い声が届いております。コメントを書くというのは、それだけ感動したという証です。</p><p>自信を持って、日々の営業に励んでいただければと思います。</p><p>※誇らしいことですので、店名を公表させていただきます。ご了承ください。</p><p>12月</p><p>1.千葉松戸東松戸店 金山責任者</p><p>一日かけて隅々まで本当に丁寧に対応してくださいました！</p><p>以前他の業者の方にお願いした時は落とし切れなかったところや、私も気づいていなかったところまでピカピカにして頂き、お掃除ワンポイントアドバイスまで頂きました！</p><p><br></p><h2 class="ql-align-center" id="heading-33"><br></h2><h2 id="heading-34"><strong>●開業閉店情報</strong></h2><h3 class="ql-align-center" id="heading-35"><br></h3><h3 id="heading-36"><strong>開業情報 (56期)</strong></h3><ul><li>青森八戸田向店</li><li>宮城仙台南店</li><li>福島いわき中央インター店</li><li>福島郡山日和田店</li><li>茨城かすみがうら店</li><li>茨城つくば二の宮店</li><li>栃木さくら店</li><li>春日部武里駅前店</li><li>入間インター店</li><li>千葉花見川朝日ヶ丘店</li><li>千葉船橋北本町店</li><li>世田谷祖師ヶ谷大蔵店</li><li>足立舎人店</li><li>横浜たまプラーザ店</li><li>厚木寿町店</li><li>神奈川相模大野店</li><li>横浜港南中央店</li><li>愛知知多店</li><li>愛知稲沢北島町店</li><li>三重鈴鹿店</li><li>大阪大手前店</li><li>鳥取駅前店</li></ul><h3 class="ql-align-center" id="heading-37"><br></h3><h3 id="heading-38"><strong>解約情報(12月)</strong></h3><ul><li>神奈川区コットンハーバー店</li><li>江戸川西小岩店</li><li>岡山岡南店</li><li>川崎新百合ヶ丘店</li></ul><h2 class="ql-align-center" id="heading-39"><br></h2><h2 id="heading-40"><strong>●売上速報</strong></h2><h3 class="ql-align-center" id="heading-41"><br></h3><h3 id="heading-42"><strong>11月 売上ランキング&nbsp;</strong></h3><p><img src="https://lh3.googleusercontent.com/WlyYGTXlzwcjjYEtTBYfaZNNY-xHz0-L62xll4VmOYdzqm1Kgc7JrZ8G7hgzxua9IiOuTDLcKx46z_C4-3bP_slbb0UEuihg_mHYNP8qem7RSAAXs6Dfjismg5Ed0JpINw=w1280"></p><h2 class="ql-align-center" id="heading-43"><br></h2><h2 id="heading-44"><strong>●エアコン型番申請報告</strong></h2><p>エアコンデータの情報共有にご協力いただきました加盟店様の紹介と結果の共有をさせていただきます。</p><p>いつもご協力いただき、ありがとうございます。</p><p><br></p><p>承認：22件　却下：10件 処理中：12件　追加型番数：228件</p><p><br></p><p>・香川高松国分寺店</p><p>リクエスト /12件 承認 /9件 却下/3件（登録済3件）</p><p><br></p><p>・中野駅前店</p><p>リクエスト /5件 承認 /3件 却下/2件（重複リクエスト2件の為）</p><p><br></p><p>・品川旗の台店</p><p>リクエスト /3件 承認 /2件 却下/1件（登録済1件の為）</p><p><br></p><p>・名古屋児玉店</p><p>リクエスト /2件 承認 /1件 却下/1件（登録済1件の為）</p><p><br></p><p>・板橋高島平店</p><p>リクエスト /1件 承認 /1件</p><p><br></p><p>・神戸灘北店店</p><p>リクエスト /1件 承認 /1件</p><p><br></p><p>・千代田麹町店</p><p>リクエスト /1件 承認 /1件</p><p><br></p><p>・広島鈴が峰町店</p><p>リクエスト /1件 承認 /1件</p><p><br></p><p>・横浜港北ﾆｭｰﾀｳﾝ店</p><p>リクエスト /1件 承認 /1件</p><p><br></p><p>・会津若松中町店</p><p>リクエスト /1件 却下/1件（該当製品なしの為）</p><p><br></p><p>・横浜青葉台店</p><p>リクエスト /1件 却下/1件（登録済の為）</p><p><br></p><p>・新潟中央区南店</p><p>リクエスト /1件 却下/1件（登録済の為）</p><h2 class="ql-align-center" id="heading-45"><br></h2><h2 id="heading-46"><strong>●情報提供</strong></h2><h3 class="ql-align-center" id="heading-47"><br></h3><h3 id="heading-48"><strong>PayPay自治体キャンペーン情報</strong></h3><p>東京都</p><p>葛飾区 第3弾	2024.12.1〜2025.1.31</p><p><br></p><p>中部地方</p><p>長野県 小布施町 第2弾 2024.12.10〜12.31</p><p><br></p><p>九州地方・沖縄</p><p>熊本県 山都町 第3弾 2025.1.6〜1.31</p><p>鹿児島県 枕崎市 第4弾 2025.2.1〜2.28</p>
